import { Route, Routes } from "react-router-dom";
import SecondPage from "./SecondPage";
import Navbar from "../Utilities/navbar/Navbar";

const Mmnnnn = () => {
    return (
        <div>
            {/* <BrowserRouter> */}
            <Routes>
                <Route path='groceries' element={
                    <Navbar/>,
                    <SecondPage />
                } />
            </Routes>
            {/* </BrowserRouter> */}
        </div>
    )
}
export default Mmnnnn;
